import React from "react";
import { Link } from "react-router-dom";

const MovieList = (props) => {
  // console.log("props MovieList", props);
  return <ul>{  props.popular.map((film) => (
    <li >
    
    <Link
      to={{
        pathname: `/${props.hash}/${film.id}`,
        state: { from: props.match.url, qwery: props.qwery },
      }}
    >
  {film.original_title}
      {/* <img
        alt="film"
        key={film.id}
        src={`https://image.tmdb.org/t/p/w300_and_h450_bestv2${film.original_title}`}
      /> */}
    </Link>
    </li>
   
  ))};
  </ul>
};

export default MovieList;
